import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from '../notes'

function createNote(data) {
  return  <Note
    //key={data.key}
    title={data.title}
    content={data.content}
  />

}

function App() {
  return (
    <div>
      <Header />
      notes
      <Footer />
    </div>
  );
}

export default App;
